// SPDX-License-Identifier: MIT

pragma solidity ^0.8.11;

import "@openzeppelin/contracts/finance/PaymentSplitter.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract HachiWallet is PaymentSplitter, Ownable {

    constructor(
        address[] memory _address, 
        uint256[] memory _shares
    ) payable
    PaymentSplitter(_address, _shares) {
    }

    function release(address payable account) public override(PaymentSplitter) {
        super.release(account);
    }

    function easyRelease() public {
        HachiWallet.release(payable(msg.sender));
    }

    function viewBalanceOwed() public view {
    }

    modifier onlyShareholder() {
        require(shares(msg.sender) > 0);
        _;
    }

    /*
    * Add Code to do the following:
    *   - Use msg.sender so no need to use address input
    *   - Functions to view current balance for address
    *   - Owner Functions to change shares if all agree to it
    *   - Similarly have ability to add/remove addresses or completely remap shares
    *   - modifier for only shareholder
    */

}

